INSERT INTO `description` VALUES ('v1','Global historical surface temperature anomalies from January 1850 onwards','The following files contain time series derived from the HadCRUT5 grids for selected regions. These best estimate series are computed as the means of regional time series computed for each of the 200 ensemble member realisations. Time series are presented as temperature anomalies (deg C) relative to 1961-1990. Time series data are provided in CSV and NetCDF formats','https://www.metoffice.gov.uk/hadobs/hadcrut5/data/current/download.html','https://www.metoffice.gov.uk/hadobs/hadcrut5/data/current/download.html'),('v2','Northern Hemisphere 2,000-year temperature reconstructio','Northern Hemisphere temperature reconstruction for the past 2,000 years by combining low-resolution proxies with tree-ring data, using a wavelet transform technique to achieve timescale-dependent processing of the data.','https://www.ncei.noaa.gov/pub/data/paleo/contributions_by_author/moberg2005/nhtemp-moberg2005.txt','https://bolin.su.se/data/moberg-2012-nh-1?n=moberg-2005'),('v3','Atmospheric CO2 concentrations from Mauna Loa measurements starting 1958','The graphs show monthly mean carbon dioxide measured at Mauna Loa Observatory, Hawaii. The carbon dioxide data on Mauna Loa constitute the longest record of direct measurements of CO2Êin the atmosphere.Ê','https://gml.noaa.gov/ccgg/trends/data.html','https://gml.noaa.gov/ccgg/about/co2_measurements.html'),('v4','Antarctic Ice Core records of atmospheric CO2 ratios combined with Mauna Loa measurements','The CO2Êrecords presented here are derived from three ice cores obtained at Law Dome, East Antarctica from 1987 to 1993. The Law Dome site satisfies many of the desirable characteristics of an ideal ice core site for atmospheric CO2Êreconstructions including negligible melting of the ice sheet surface, low concentrations of impurities, regular stratigraphic layering undisturbed at the surface by wind or at depth by ice flow, and high snow accumulation rate.Ê','https://cdiac.ess-dive.lbl.gov/ftp/trends/co2/lawdome.combined.dat','https://cdiac.ess-dive.lbl.gov/trends/co2/lawdome.html'),('v5','Vostok Ice Core CO2 measurements 417160 - 2342 years','In January 1998, the collaborative ice-drilling project between Russia, the United States, and France at the Russian Vostok station in East Antarctica yielded the deepest ice core ever recovered, reaching a depth of 3,623 m (Petit et al. 1997, 1999). Ice cores are unique with their entrapped air inclusions enabling direct records of past changes in atmospheric trace-gas composition. Preliminary data indicate the Vostok ice-core record extends through four climate cycles, with ice slightly older than 400 kyr (Petit et al. 1997, 1999).Ê','https://cdiac.ess-dive.lbl.gov/ftp/trends/co2/vostok.icecore.co2','https://cdiac.ess-dive.lbl.gov/trends/co2/vostok.html'),('v6','Ice core 800k year composite study CO2 measurements','Revised EPICA Dome C and Antarctic composite ice core atmospheric CO2 data. This new version of the CO2 composite replaces the old version of Luthi et al. (2008), which contains the analytical bias described in Bereiter et al. 2015 and lower quality data in other sections.','https://www.ncei.noaa.gov/pub/data/paleo/icecore/antarctica/antarctica2015co2composite.txt','https://www.ncei.noaa.gov/access/paleo-search/study/17975'),('v7','Evolution of global temperature over the past two million years','The chart present a spatially weighted proxy reconstruction of global temperature over the past 2 million years estimated from a multi-proxy database of over 2000 sea surface temperature point reconstructions.','http://carolynsnyder.com/publications.php','https://climate.fas.harvard.edu/files/climate/files/snyder_2016.pdf'),('v8','CO2 emissions by country','The Global Carbon Project facilitates access to data to encourage its use and promote a good understanding of the carbon cycle. Respecting original data sources is key to help secure the support of data providers to enhance, maintain and update valuable data.',' https://data.icos-cp.eu/licence_accept?ids=%5B%22lApekzcmd4DRC34oGXQqOxbJ%22%5D','https://www.icos-cp.eu/science-and-impact/global-carbon-budget/2021'),('v9','CO2 emissions by sectors','This chart shows the distribution of CO2Êemissions across sectors.The global breakdown for CO2 is similar to that of total greenhouse gases Ð electricity and heat production dominates, followed by transport, and manufacturing and construction.','https://ourworldindata.org/uploads/2020/09/Global-GHG-Emissions-by-sector-based-on-WRI-2020.xlsx','https://ourworldindata.org/emissions-by-sectorco2-emissions-by-sector'),('v10','Human Evolution and Activities','','https://www.southampton.ac.uk/cpd/history.html','https://www.southampton.ac.uk/cpd/history.html');
