L,NULL),(1985,'346.35',NULL,NULL,NULL,'400','Discovery of a human-induced hole in the stratospheric ozone layer (1985) --> increase in UV-B radiation at Earthâ€™s surface, changingÂ climate, causing DNA damage toÂ phytoplanktonÂ andÂ plants; potentialÂ forest sterilityÂ andÂ skin cancers'),(1986,'347.61',NULL,NULL,NULL,'400','Global population of humans passesÂ 5 billion; annual energy use per person averagesÂ 18,300 kWh, 26x the resting metabolism'),(1987,'349.31',NULL,NULL,NULL,'400','Global agreement to ban hydrochlorofluorocarbons and other ozone depleting substances (Montreal Protocol,Â 1987), the only UN protocol to be ratified by every country on Earth -->Â punctuatedÂ recovery of stratospheric ozone, slowing Earthâ€™sÂ warming'),(1988,'351.69',NULL,NULL,NULL,'400','First assessment that global climate warming has begun (James Hansen, Senate testimony to US Congress,Â 23/6/1988) --> creation of the IPCC,Â 1988; human imperative to stabiliseÂ climate change'),(1989,'353.20',NULL,NULL,NULL,NULL,NULL),(1990,'354.45',NULL,NULL,NULL,NULL,NULL),(1991,'355.70',NULL,NULL,NULL,NULL,NULL),(1992,'356.54',NULL,NULL,NULL,NULL,NULL),(1993,'357.21',NULL,NULL,NULL,NULL,NULL),(1994,'358.96',NULL,NULL,NULL,NULL,NULL),(1995,'360.97',NULL,NULL,NULL,NULL,NULL),(1996,'362.74',NULL,NULL,NULL,'400','First practical solar-powered aircraft (IcarÃ© 2, Germany,Â 1996) --> race forÂ clean-energyÂ applications; gradually emergingÂ politicalÂ vision for weaning off fossil fuels'),(1997,'363.88',NULL,NULL,NULL,'400','Adoption of the Kyoto Protocol by 192 countries (UNFCC,Â 1997), binding 37 industrialised and industrialising countries plus the EU to targets for reducing greenhouse gas emissions --> still rising byÂ 2021'),(1998,'366.84',NULL,NULL,NULL,NULL,NULL),(1999,'368.54',NULL,NULL,NULL,NULL,NULL),(2000,'369.71',NULL,NULL,NULL,'400','Ongoing and accelerating rise in global mean sea level exceeds 3 mm/year byÂ 2000, regulated by thermal expansion, ice-mass loss and large-scale dams -->Â no scenarioÂ that stops sea-level rise this century'),(2001,'371.32',NULL,NULL,NULL,NULL,NULL),(2002,'373.45',NULL,NULL,NULL,NULL,NULL),(2003,'375.98',NULL,NULL,NULL,'400','A heatwave across Europe causes 70,000 additional deaths inÂ summer 2003, then with a return time of thousands of years --> 100 years byÂ 2015; rising frequency of record-shatteringÂ climate extremes, includingÂ marine heatwaves'),(2004,'377.70',NULL,NULL,NULL,NULL,NULL),(2005,'379.98',NULL,NULL,NULL,NULL,NULL),(2006,'382.09',NULL,NULL,NULL,NULL,NULL),(2007,'384.02',NULL,NULL,NULL,NULL,NULL),(2008,'385.83',NULL,NULL,NULL,'400','First country to adopt circular-economy legislation (China,Â 2008): reduce, reuse, recycle --> national roadmaps byÂ 2016; need forÂ global initiatives'),(2009,'387.64',NULL,NULL,NULL,'400','Humanity is overstepping threeÂ planetary boundariesÂ to aÂ safe operatingÂ space: climate change, biodiversity loss,Â nitrogen cycleÂ --> risk ofÂ abruptÂ ecological disruption, biosphereÂ tipping points, andÂ hothouse Earth; need forÂ planetary stewardship. Nations that grew rich on fossil fuels commit climate finance to poorer nations (UN FCCC, 2009), worth one-tenth of annual oil and gas industry royalties by 2020 --> inadequate, and still a shortfall by 2021.'),(2010,'390.10',NULL,NULL,NULL,NULL,NULL),(2011,'391.85',NULL,NULL,NULL,NULL,NULL),(2012,'394.06',NULL,NULL,NULL,NULL,NULL),(2013,'396.74',NULL,NULL,NULL,'400','Atmospheric concentrations of CO2 exceed 400 ppm for the first time in at least 3 million years, an accelerating rise (NOAA, Hawaii,Â 5/2013) --> race for technologies toÂ captureÂ andÂ useÂ CO2'),(2014,'398.81',NULL,NULL,NULL,NULL,NULL),(2015,'401.01',NULL,NULL,NULL,'400','Tipping point in industry-wide momentum towards electric vehicles duringÂ mid-2010s, when still comprising 2% of market share, spread by investor confidence under strengthening regulation of fossil fuels. UN General Assembly of 194 countries adopts 17 Sustainable Development Goals for 2030, to end poverty and other deprivations by improving health and education, reducing inequalities, addressing climate change and halting biodiversity loss (25/9/2015). UN Paris Agreement on Climate Change adopted by 196 nation states, resolving to keep global average temperature to well below 2Â°C in excess of pre-industrial levels, and striving to limit the increase to 1.5Â°C (12/12/2015) --> slower losses of sea ice, permafrost, and biodiversity; by 2022, no credible pathway to 1.5Â°C.'),(2016,'404.41',NULL,NULL,NULL,'400','Destruction of more than 6 million ha (60,000 km2) of tropical primary forest during 2016, an unprecedented peak in a rising trend --> quick profit from drawing down natural capital, a down payment on future economic failure. Global land and ocean surface temperature for 2016 reaches 0.99Â°C above the 1951-1980 mean, Earthâ€™s warmest year on record to date --> roadmap for decarbonisation, implicating lifestyle choices.'),(2017,'406.76',NULL,NULL,NULL,'400','First national legislation for a mid-century target ofÂ net-zero emissionsÂ (Sweden,Â 2017) --> Suriname and Bhutan CO2-negative byÂ 2019; net-zeroÂ pledgesÂ by governments andÂ companiesÂ cover 90% of the global economy byÂ 2021, with big emitters yet toÂ peak'),(2018,'408.72',NULL,NULL,NULL,'400','Sixfold increase in annual ice loss fromÂ AntarcticaÂ andÂ GreenlandÂ over 25 years to 2018 --> sea-levels to rise 40-80 cm byÂ 2100Â under scenarios of low-high greenhouse gas emissions,Â displacingÂ 190-630 million people. Slowing Atlantic circulation over the last 60 years, consistent with rising CO2, enhancing global surface warming.'),(2019,'411.66',NULL,NULL,NULL,'400','Britain generates more electricity from zero-carbon sources than from fossil fuels for the first time since the Industrial Revolution (UK National Grid,Â 6/2019);Â fossil fuelsÂ still provide 84% of global primary energy. Acidification of almost all open-ocean surface by absorption of anthropogenic CO2, losing 0.02 pH units per decade since 1990, with current harm and projected threats to shell-forming species.'),(2020,'414.24',NULL,NULL,NULL,'400','Ambient temperature in the Arctic exceeds the 1981-2010 average by 2.1Â°C inÂ 2020, warmingÂ 4x fasterÂ than the rest of the world; permafrost thawing self-amplifies to the point ofÂ no return; ArcticÂ zombie firesÂ release 4x the CO2 emissions of globalÂ volcanic activity'),(2021,'416.45',NULL,NULL,NULL,'400','Tropical forests in south-eastern Amazonia switch from CO2 sink to source byÂ 2021, linked to intensifying dry seasons, deforestation and rising frequency of fires. Earthâ€™s hottest month on record (NOAA, July 2021): rising frequency of climate anomalies --> need for actions to trigger positive tipping towards global sustainability through self-reinforcing shifts in behaviour.');
